Концентрированный автомобильный шампунь.
Преимущества:
- обильное пенообразование;
- глубокий очищающий уход;
- удаление самых стойких дорожных загрязнений, таких как пятна бензина, масла и дорожной грязи, следы от насекомых;
- эффективное очищение лакокрасочных покрытий, стёкол, пластиковых, резиновых и хромированных деталей автомобиля, а также колёсных дисков;
- образование на поверхности тонкой полимерной плёнки;
- автомобиля блеск кузова;
- легко разводится в холодной и горячей воде и легко смывается, не оставляя пятен и следов на кузове;
- в составе содержатся антикоррозионные добавки и нет солевых компонентов, поэтому не вызывает коррозию кузова;
- безопасен для любого типа лакокрасочных покрытий, резиновых, пластиковых и хромированных деталей;
- биоразлагаем, поэтому не наносит вреда окружающей среде;

Зарядно-предпусковое устройство Carfort Charge 20
Даже если ваша батарея будет разряжена до нуля, вы сможете восстановить её работоспособность с помощью Carfort Charge20.
Рабочие режимы для разных типов АКБ:
7,5 В –Автоматический режим для 6-вольтовых кислотных АКБ;
15 В – Автоматический режим для 12-вольтовых кислотных АКБ;
19 В – Ручной режим для 12-вольтовых кислотных АКБ.
Характеристики:
Вес: 0,9 кг;
Регулировка тока: 0,4-7 А;
Максимальный ток заряда: 7 А;
Можно использовать как источник питания.

Кабель-переходник с USB-разъемом.
Для смартфонов, планшетов, навигаторов и т.д.
- с микро-USB;
- с плетеной шелковой оплеткой;
- подходит для подключения к USB-порту компьютера (позволяет заряжать и обмениваться данными одновременно);
- подходит для подключения к зарядному устройству с USB-портом.

Универсальное автомобильное зарядное устройство (адаптер питания) с двумя USB-портами (2,1 А).
Для iPhone, телефонов, смартфонов, навигаторов и других USB-устройств.
- компактный размер;
- работает от прикуривателя (12-24 В);
- два USB-порта (5В, 1А+1А, суммарно 2,1 А);
- светодиодный индикатор работы.
Вход: 12/24 В.
Выход: 5В/2,1А суммарно.
Цвет: черный.

